#! /bin/sh
#
#  DO NOT EDIT THIS FILE
#
#  It is generated by mkconfig.sh.  Make necessary changes there.
#		      
# ----------------------------------------------------------------------
SVDIR=`pwd`
cd `echo $0 | sed 's;/[^/]*$;;'`
SRCDIR=`pwd`

if [ ! -f ./configure.in ]
then
  echo cannot locate top source directory for AutoGen
  exit 1
fi

if [ -z "${VERBOSE}" ]
then VERBOSE=false ; VERBOSE_ARG=""
else VERBOSE=true ; VERBOSE_ARG="-x" ; set -x ; fi
export VERBOSE VERBOSE_ARG

#  Touch the stamp-* files so bootstrap.dir won't try to build them
#
touch -t 200001010000 \
        agen5/stamp-opts      agen5/stamp-directive agen5/stamp-exprini \
        agen5/stamp-fsm       agen5/stamp-parse     agen5/stamp-texi \
        agen5/stamp-man

for f in  TODO                          agen5/autogen.1 \
          agen5/autogen.menu            agen5/autogen.texi \
          agen5/cgi-fsm.h               agen5/defParse-fsm.h \
          agen5/directive.h             agen5/expr.h \
          agen5/expr.ini                agen5/opts.c \
          agen5/opts.h                  agen5/proto.h \
          agen5/pseudo-fsm.h            autoopts/autoopts/options.h \
          autoopts/autoopts/usage-txt.h autoopts/funcs.def \
          autoopts/genshell.c           autoopts/genshell.h \
          autoopts/proto.h              columns/opts.c \
          columns/opts.h                compat/strsignal.h \
          config/ag_macros.m4           config/libopts.m4 \
          config/snprintfv.m4           getdefs/proto.h \
          snprintfv/filament.h          snprintfv/filament.stamp \
          snprintfv/printf.h            snprintfv/printf.stamp \
          snprintfv/stream.h            snprintfv/stream.stamp
do
  if [ -f $f ]
  then
    rm -f $f || {
      echo cannot remove $f
      exit 1
    }
  fi
done

( uudecode -o /dev/stdout | \
  gunzip | \
  tar -xvf -
